import React from 'react';
import {useSelector } from 'react-redux'
import Loading from '../Loading/Loading';
//import SearchBar from '../SearchBar/SearchBar';
import NavBar from "."
const Home = () => {    
    const isLoading = useSelector( state => state.loading );
    return (
        <div >
             {
            isLoading ? <Loading/> :
                <div>
                   <NavBar />
                </div>
             }
        </div>
    )
};

export default Home;
